import {
  WEATHER_API_KEY,
  OPEN_WEATHER_API_KEY,
  OPEN_WEATHER_BASE_URL,
} from "../constants/api";
import Axios from "./main/mainApi";

const getWeatherData = async (searchValue) => {
  return Axios.get(`/forecast.json?q=07112&days=7&key=${WEATHER_API_KEY}`);
};

const weatherApi = {
  getWeatherData,
};

export default weatherApi;
